        "hrzone_intro_notitle_des": MessageLookupByLibrary.simpleMessage(
            "As seguintes são as descrições das nossas zonas de frequência cardíaca padrão. Se você as personalizar para diferentes propósitos de treino, as descrições podem não corresponder a essas zonas"),
        "hrzone_intro_understandhr": MessageLookupByLibrary.simpleMessage(
            "Compreensão da Zona de Frequência Cardíaca"),
        "hrzone_intro_understandhr_des": MessageLookupByLibrary.simpleMessage(
            "Cada zona de frequência cardíaca influencia o seu corpo durante o treino. Focar em diferentes zonas ajuda a construir uma rotina equilibrada para força, resistência e potência. As zonas mais baixas são ótimas para aquecer e recuperar, enquanto as zonas mais altas impulsionam o progresso"),
        "hrzone_intro_zone1":
            MessageLookupByLibrary.simpleMessage("Zona 1 Aquecimento"),
        "hrzone_intro_zone1_des": MessageLookupByLibrary.simpleMessage(
            "O treinamento nesta zona melhora a capacidade do seu coração de bombear sangue e aprimora a capacidade dos músculos de utilizar oxigênio. O corpo se torna mais eficiente em alimentar os músculos em atividade e aprende a metabolizar a gordura como fonte de energia."),
        "hrzone_intro_zone2":
            MessageLookupByLibrary.simpleMessage("Zona 2 Fácil"),
        "hrzone_intro_zone2_des": MessageLookupByLibrary.simpleMessage(
            "Essa zona oferece os mesmos benefícios da Zona 1, mas é mais intensa e queima mais calorias totais."),
        "hrzone_intro_zone3":
            MessageLookupByLibrary.simpleMessage("Zona 3 Aeróbico"),
        "hrzone_intro_zone3_des": MessageLookupByLibrary.simpleMessage(
            "Mais eficaz para a aptidão cardiovascular geral. Aumenta sua capacidade cardiorrespiratória: ou seja, sua capacidade de transportar sangue oxigenado para as células musculares e dióxido de carbono para longe das células. Também eficaz para aumentar a força muscular geral."),
        "hrzone_intro_zone4":
            MessageLookupByLibrary.simpleMessage("Zona 4 Limiar"),
        "hrzone_intro_zone4_des": MessageLookupByLibrary.simpleMessage(
            "O ponto em que o corpo não pode remover o ácido lático tão rapidamente quanto é produzido é chamado de limiar de lactato ou limiar anaeróbico. Geralmente ocorre cerca de 88% da Zona de Frequência Cardíaca. O treinamento nesta zona ajuda a aumentar o limiar de lactato, o que melhora o desempenho. O treinamento nesta zona é difícil: seus músculos estão cansados, sua respiração é pesada."),
        "hrzone_intro_zone5":
            MessageLookupByLibrary.simpleMessage("Zona 5 Máximo"),
        "hrzone_intro_zone5_des": MessageLookupByLibrary.simpleMessage(
            "Você só deve treinar nessa zona se estiver em boa forma física e apenas por períodos muito curtos de tempo. O ácido lático se desenvolve rapidamente, pois você está operando com déficit de oxigênio nos músculos. O valor do treinamento nesta zona é que você pode aumentar as fibras musculares de contração rápida, o que aumenta a velocidade."),
