        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "A variabilidade da frequência cardíaca, também conhecida como VFC, representa a variação no tempo entre cada batimento cardíaco. Assim, enquanto sua frequência cardíaca mede quantas vezes seu coração bate por minuto, a VFC é a variação no tempo entre esses batimentos."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "Sua variabilidade da frequência cardíaca é uma expressão importante de quão bem você consegue lidar e se recuperar do estresse, seja ele um estressor físico (como exercício ou doença) ou um estressor emocional e mental (como ansiedade). Aumentar sua variabilidade da frequência cardíaca significa dormir melhor, reduzir a dor e melhorar sua saúde e aptidão física geral."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "Sua variabilidade individual da frequência cardíaca é representada pela sua pontuação de VFC. A VFC é geralmente medida em milissegundos, sendo uma pontuação de VFC mais alta indicativa de uma melhor saúde."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Sua variabilidade individual da frequência cardíaca é representada pela sua pontuação de VFC. A VFC é geralmente medida em milissegundos, sendo uma pontuação de VFC mais alta indicativa de uma melhor saúde."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "O sistema nervoso simpático, comumente conhecido como modo \"lutar ou fugir\", é ativado involuntariamente quando o corpo percebe uma ameaça. Para se proteger, o corpo utiliza o sistema nervoso simpático para acelerar a respiração, aumentar a pressão arterial e elevar hormônios do estresse como o cortisol, para garantir que você tenha toda a energia e recursos necessários para se manter seguro em uma situação perigosa."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "O sistema nervoso parassimpático, também conhecido como modo \"descanso e digestão\", é um estado de relaxamento. Diminui a frequência cardíaca, retarda a respiração e permite que o corpo retorne à homeostase (um equilíbrio natural). Quando você está em um estado parassimpático, seu corpo se sente seguro ao redistribuir o fluxo sanguíneo e a energia para funções restauradoras como sono, digestão e reprodução."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Portanto, uma alta variância no tempo entre seus batimentos cardíacos, também conhecida como uma pontuação HRV alta, significa que seu sistema nervoso autônomo é capaz de reagir eficientemente, ativando o sistema nervoso simpático para lidar com situações estressantes e depois mudando para o estado parassimpático relaxado quando a ameaça passou."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Avaliação de Intensidade e Recuperação: Ao monitorar a HRV, os indivíduos podem obter uma compreensão mais precisa de seus níveis de fadiga física e estado de recuperação. Uma HRV mais baixa pode indicar overtraining ou recuperação inadequada, levando a ajustes no plano de treino, como aumentar os períodos de descanso ou mudar para exercícios de baixa intensidade para evitar tensões excessivas."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Conexão entre Estresse Psicológico e Desempenho Físico: O estresse psicológico prolongado pode levar à diminuição da HRV, afetando o desempenho atlético. Portanto, manter uma boa HRV contribui para estados psicológicos e fisiológicos ótimos, melhorando assim o desempenho competitivo."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "Em resumo, a Variabilidade da Frequência Cardíaca desempenha um papel fundamental na orientação de rotinas de exercícios individuais, monitoramento do estado geral de saúde e previsão do desempenho atlético. Acompanhando e analisando as mudanças na HRV, as pessoas podem tomar decisões informadas e científicas sobre seu regime de condicionamento físico."),
